import React, { useEffect, useState } from 'react';

const RealtimePessimismDetection = () => {
    const [pessimismLevel, setPessimismLevel] = useState('');

    useEffect(() => {
        const socket = new WebSocket('ws://localhost:8000/ws/pessimism_detection/');

        socket.onopen = () => {
            console.log('WebSocket connection established');
        };

        socket.onmessage = (event) => {
            const data = JSON.parse(event.data);
            setPessimismLevel(data.pessimism_level);
        };

        socket.onclose = () => {
            console.log('WebSocket connection closed');
        };

        return () => {
            socket.close();
        };
    }, []);

    return (
        <div>
            <h1>Real-Time Pessimism Detection</h1>
            <p>Pessimism Level: {pessimismLevel}</p>
        </div>
    );
};

export default RealtimePessimismDetection;
